Azure cosmos throwing error for $round in MongoDB query pipeline<p>I am using Azure Cosmos MongoDB and storing API Request logs. I wanted to know how many request were made per second. So I am grouping them on basis of timestamp after dividing the timestamp by 1000 then rounding off with 0 decimal places</p>
<blockquote>
<p>1593096483234 to 1593096483.234 to 1593096483</p>
</blockquote>
<p>and taking count of documents furnished by above grouping then sorting on basis of count in decreasing order.</p>
<p>Query</p>
<pre><code>db.server_api_logs.aggregate([
   {
      &quot;$group&quot;: {
         &quot;_id&quot;: &quot;$timestamp&quot;
      }
   },
   {
      &quot;$project&quot;: {
         &quot;summation&quot;: {
            &quot;$round&quot;: {
               &quot;$toDouble&quot;: {
                  &quot;$divide&quot;: [&quot;$_id&quot;,1000]
               }
            }
         }
      }
   },
   {
      &quot;$group&quot;: {
         &quot;_id&quot;: &quot;$summation&quot;,
         &quot;summer&quot;: {&quot;$sum&quot;: 1}
      }
   },
   {
      &quot;$sort&quot;: {&quot;summer&quot;: -1}
   }
]
</code></pre>
<p>Getting this error when try to run above query</p>
<pre><code>Unable to execute the selected commands

Mongo Server error (MongoCommandException): Command failed with error 168 (168): 'unknown operator: $round' on server &lt;server address&gt; 

The full response is:
{ 
    &quot;ok&quot; : 0.0, 
    &quot;errmsg&quot; : &quot;unknown operator: $round&quot;, 
    &quot;code&quot; : NumberInt(168), 
    &quot;codeName&quot; : &quot;168&quot;
}
</code></pre>
<p>It is working totally fine on local using compass but not on Cosmos using Robo3T. Am I doing something wrong?</p>

