How to fix TypeError: Cannot read property 'hash' of undefined during hashing password for GraphQL mutation with bcryptjs?<p>I am relatively new to Node/GraphQL/MongoDB/Moogose.
I am trying to create a mutation to encrypt the user's password using bcryptjs instead of plain text. However, I am having this error:
<strong>TypeError: Cannot read property 'hash' of undefined</strong></p>

<p>I came from Python background and I am having some difficulty understanding how async programming
Here's my code block of my schema.js</p>

<pre><code>const RootMutation = new GraphQLObjectType({
    name: 'RootMutationType',
    fields: {
    createUser: {
        type: UserType,
        args: {
            email: { type: new GraphQLNonNull(GraphQLString) },
            password: { type: new GraphQLNonNull(GraphQLString) },
        },
        resolve(parents, args) {
            User.findOne({ email: args.email })
                .then(user =&gt; {
                    if(user) {
                        throw new Error('This email has already been used!');
                    }
                    return bcrypt.hash(args.password, 12);    // Error at this line
                })
                .then(hashedPassword =&gt; {
                    let user = new User({
                        email: args.email,
                        password: hashedPassword,
                    });
                    return user.save();
                })
                .catch(err =&gt; {
                    throw err;
                });
        }
    }
</code></pre>

<p>I have tried, but i've gotten the error Cannot read property 'genSalt' of undefined:</p>

<pre><code>createUser: {
            type: UserType,
            args: {
                email: { type: new GraphQLNonNull(GraphQLString) },
                password: { type: new GraphQLNonNull(GraphQLString) },
            },
            resolve(parents, args) {
                User.findOne({ email: args.email })
                    .then(user =&gt; {
                        if(user) {
                            throw new Error('This email has already been used!');
                        }
                        bcrypt.genSalt(10, function(err, salt) {
                            bcrypt.hash(args.password, salt, function(err, hash) {
                                let user = new User({
                                    email: args.email,
                                    password: hash,
                                });
                                return user.save();
                            });
                        });
                    });
</code></pre>

<p><strong>Update:</strong>
I am now able to create a user in my MongoDB after change to the below:
Turns out it is because I am using:</p>

<p><code>const {bcrypt} = require('bcryptjs');</code></p>

<p>instead of </p>

<p><code>const bcrypt = require('bcryptjs');   // this is working</code></p>

<p>Can someone explain what is the difference? I am using ES6.</p>

<p>Also my graphql <strong>mutation</strong> doesn't seem to return me the correct query. 
Mutation cmd</p>

<pre><code>mutation {
  createUser(email: "test3@test.com", password: "testpassword") {
    email
    password
  }
}

</code></pre>

<p>Result:</p>

<pre><code>{
  "data": {
    "createUser": null
  }
}
</code></pre>

