<p>Which allows the model to accept date strings (ex: <code>2020-01-01</code>) and date objects. Now this will store all dates at midnight UTC time, that way I still get all the advantages of them being stored as dates in mongodb.</p>

<p>Where my issue comes in is that when I'm returning one of these dates to the API it gets returned in full ISO format (ex: <code>2020-01-01T00:00:00.000Z</code>), which will get converted into the local user's time zone. In my timezone, this date will show up as 1 day earlier than desired.</p>

