<p>I've tried inheriting from the Date class, but I discovered it isn't compatible with how mongoose and the mongodb driver work.</p>

<p>I know I could write a method to put in the <code>toJSON.transform</code> options, but then I'd have to do this for every field and model that uses the type.</p>; Answer: 1. Don't use the deprecated `mysql_*`-functions. They are deprecated since PHP 5.5 and completely removed in PHP 7. Use MySQLi or PDO instead. 2. You are wide open to [SQL Injections](http://php.net/manual/en/security.database.sql-injection.php) and should really use [Prepared Statements](http://php.net/manual/en/mysqli.quickstart.prepared-statements.php) instead of concatenating your queries, which can be used if you use the above mentioned MySQLi or PDO.

