Trailing zeros in byte array from RawBsonDocument.getByteBuffer().array() in org.Bson<p>I am trying to encode an org.Json JSONObject into a BSON format byte[].
I have noticed, however, that the resulting byte[] has trailing zeros. While these zeros do not pose a problem when deserializing the byte[] to JSON again, they do however take up a lot of space.
My code is the following:</p>

<pre><code>#deserializing incoming message
RawBsonDocument bson = new RawBsonDocument((byte[])incomingBson);
json = new JSONObject(bson.toJson());

#serializing response to **bson format**
RawBsonDocument bsonDoc = RawBsonDocument.parse(json.toString());
responseBson = bsonDoc.getByteBuffer().array();
</code></pre>

<p>Simply trimming the byte[] from all trailing zeroes is not an option, since the byte[] can very well have valid zeros at the end, that where not added by the serialization.</p>

<p><strong>Edit 1</strong></p>

<p>I solved the issue with the following code:</p>

<pre><code>RawBsonDocument bsonDoc = RawBsonDocument.parse(json.toString());
responseBson = Arrays.copyOfRange(bsonDoc.getByteBuffer().array(), 0, bsonDoc.getByteBuffer().limit());

</code></pre>

<p>I feel as tough the must be a more elegant answer</p>

