<p>This is a simplified version of the example that is currently in the <a href="https://immutables.github.io/mongo.html" rel="nofollow noreferrer">immutables site</a>.</p>
<p>So I have an item that I want to use with MongoDB.</p>
<pre><code>@Value.Immutable
@Mongo.Repository(&quot;items&quot;)
public abstract class Item {
  @Mongo.Id
  public abstract long id();
  public abstract String name();
}
</code></pre>
<p>For simplicity I create a Junit test. Just like the example.
The problem is that this junit test, while it is presented  in the example at the <a href="https://immutables.github.io/mongo.html" rel="nofollow noreferrer">immutables site</a> throws an exception:</p>
<pre><code>public class ItemTest{
@Test
public void testRepository() {
try {
 //Simple ItemRepository creation
   ItemRepository items = new ItemRepository(
     RepositorySetup.forUri(&quot;mongodb://localhost/test&quot;)
     );

// Create item Item item = ImmutableItem.builder()
    .id(1)
    .name(&quot;one&quot;)
    .build();

    //Insert is async. Returns a Future. 
    FluentFuture&lt;Integer&gt; future=items.insert(item);
    future.get(); // get the result (ensure it was saved)

   }catch(Exception e){
       e.printStackTrace();
       Assert.fail(e.getMessage());
   }
}//end test

}//end class
</code></pre>
