<p><strong>Identified cause</strong></p>
<p>The Immutables JSON library needs to be able to find the autogenerated <code>GsonAdaptersItem.class</code> that <code>implements com.google.gson.TypeAdapterFactory</code>. In fact for every <code>interface</code> or <code>abstract class</code> named <code>XXX</code> with a similar annotation as in the 'class Item' (provided above) Immutables will generate a similar <code>GsonAdapterXXX</code> that  <code>implements com.google.gson.TypeAdapterFactory</code></p>
<p>In order to be able to find these classes automatically <code>RepositorySetup</code> uses <code>java.util.ServiceLoader</code> to automatically locate them.
This is the related code part:</p>
<pre><code>    GsonBuilder gsonBuilder = new GsonBuilder();
